import sys

def find_sccs(n, edges):
    def dfs(node, graph, visited, stack=None):
        visited[node] = True
        for neighbor in graph[node]:
            if not visited[neighbor]:
                dfs(neighbor, graph, visited, stack)
        if stack is not None:
            stack.append(node)

    stack = []
    visited = [False] * n
    for node in range(n):
        if not visited[node]:
            dfs(node, edges, visited, stack)

    reverse_edges = [[] for _ in range(n)]
    for u in range(n):
        for v in edges[u]:
            reverse_edges[v].append(u)

    visited = [False] * n
    scc_count = 0
    while stack:
        node = stack.pop()
        if not visited[node]:
            dfs(node, reverse_edges, visited)
            scc_count += 1

    return scc_count

