    n = int(input[0])
    positions = list(map(int, input[1:]))

    edges = [[] for _ in range(n)]
    sorted_positions = sorted((pos, i) for i, pos in enumerate(positions))

    for i in range(1, n):
        prev_pos, prev_idx = sorted_positions[i-1]
        curr_pos, curr_idx = sorted_positions[i]

        if i > 1:
            prev_prev_pos, prev_prev_idx = sorted_positions[i-2]
