## Approach

The approach uses dynamic programming with memoization (top-down). For each position in the string, we try all possible deletions that are valid according to the rules:

1. We can always delete the entire remaining string.
2. If a prefix of length `i` matches the next `i` characters, we can delete that prefix.

We use recursion with memoization (`@lru_cache`) to avoid recomputing results for the same starting index.

## Complexity

- **Time complexity:** O(n^3) where n is the length of the string. The cubic factor comes from checking all possible prefixes and their matches.
- **Space complexity:** O(n) for the memoization cache and recursion stack.

