from functools import lru_cache

class Solution:
    def deleteString(self, s: str) -> int:
        n = len(s)

        # Precompute longest common prefix (LCP) array to speed up substring comparisons
        # lcp[i][j] represents the length of the longest common prefix starting at i and j
        lcp = [[0] * (n + 1) for _ in range(n + 1)]
        for i in range(n - 1, -1, -1):
            for j in range(n - 1, -1, -1):
                if s[i] == s[j]:
                    lcp[i][j] = lcp[i+1][j+1] + 1

        @lru_cache(None)
        def dfs(start: int) -> int:
            # Base case: if we've reached the end, no more operations needed
            if start >= n:
                return 0

            max_ops = 1  # At least one operation (delete entire string from this point)

            # Try all possible deletions starting at 'start'
            for i in range(1, (n - start) // 2 + 1):
                # Check if s[start:start+i] matches s[start+i:start+2*i]
                if lcp[start][start + i] >= i:
                    max_ops = max(max_ops, 1 + dfs(start + i))

            return max_ops

        # Special case: if all characters are the same, we can delete one by one
        if len(set(s)) == 1:
            return n

        return dfs(0)
