def can_reach(N, snow_depths, boots):
    from collections import deque

    def bfs(start_boot):
        queue = deque([(1, start_boot)])
        visited = set((1, start_boot))

        while queue:
            current_tile, boot = queue.popleft()

            if current_tile == N:
                return 1

            max_snow_depth, step_size = boots[boot]

            for next_tile in range(current_tile + 1, min(N + 1, current_tile + step_size + 1)):
                if snow_depths[next_tile] <= max_snow_depth and (next_tile, boot) not in visited:
                    queue.append((next_tile, boot))
                    visited.add((next_tile, boot))

        return 0

    results = []
    for i in range(len(boots)):
        results.append(bfs(i))

    return '\n'.join(map(str, results))

